import React from 'react';

/**
 * Component for displaying address 'keys' and 'values' to the user profile UI
 * @param {string} label - the bold label for the item
 * @param {string} value - the data associated with the label
 */
const AddressItem = ({ label, value }) => (
  <div className="p-1">
    <div className="m-1 list-group-item">
      <b>{`${label}: `}</b>
      <span className="text-dark">{value}</span>
    </div>
  </div>
);

export default AddressItem;
